import car from "./car.jpg";

function CarInfo({ carDetails }) {
  return carDetails ? (
    <div class="">
      <h1>Car Info displays here</h1>
      <p>{carDetails.registration}</p>
      <p>{carDetails.make}</p>
      <p>{carDetails.model}</p>
      <p>{carDetails.primaryColour}</p>
      <p>{carDetails.motTests[0].expiryDate}</p>
      <p>{carDetails.motTests[0].odometerValue}</p>
    </div>
  ) : (
    <div>
      <p class="text-center">Please insert a valid registration number.</p>
      <img
        src={car}
        alt="car"
        class="h-48 md:h-96 w-full object-cover rounded-xl grid place-items-center"
      />
    </div>
  );
}

export default CarInfo;
